import React from 'react'
import { useNavigate } from "react-router-dom";
import {useState} from 'react'
import '../assets/scss/Register.scss'
import { Grid } from "../assets/UiKit/grid/Gird";
import { Line,Rows } from "../assets/UiKit/Line/Line";

export default function Register() {

    const [registerEmail, setRegisterEmail] = useState("");
    const [registerPassWord, setRegisterPassword] = useState("");
    const [confirmationPassWord, setConfirmationPassWordPassword] = useState("");
    const [registerPhone, setRegisterPhone] = useState("");
    const [displayName, setDisplayName] = useState("");
    const [errorMessage, setErrorMessage] = useState("");

    function handleSubmit(e) {
      e.preventDefault();
      registerPassWord === confirmationPassWord
        ? register()
        : setErrorMessage(
            "ERROR: Your password and confirmation password do not match."
          );
    }
    const userDetails = {
      f_name: displayName,
      L_name: displayName,
      email: registerEmail,
      password: registerPassWord,
      phone_num: registerEmail,
      // bio
    };
    function register() {
      console.log("registering");
      console.log(userDetails);
    }
  return (
    <div>
    <Grid>
    <h2>Register User</h2>
        <form className="registerDiv" onSubmit={handleSubmit}>

    <Rows>
        <label>First Name</label>
        <input
          type="text"
          value={displayName}
          onChange={(e) => setDisplayName(e.target.value)}
        />
        <label>Last name</label>
        <input
          type="text"
          value={displayName}
          onChange={(e) => setDisplayName(e.target.value)}
        />
        <label>Email</label>
        <input
          type="text"
          value={registerEmail}
          onChange={(e) => setRegisterEmail(e.target.value)}
        />
        <label>Phone Number</label>
        <input
          type="text"
          value={registerPhone}
          onChange={(e) => setRegisterEmail(e.target.value)}
        />
        <label>Password</label>
        <input
          type="password"
          value={registerPassWord}
          onChange={(e) => setRegisterPassword(e.target.value)}
        />
        <label>Confirm Password</label>
        <input
          type="password"
          value={confirmationPassWord}
          onChange={(e) => setConfirmationPassWordPassword(e.target.value)}
        />
        <button type="submit"
        handleSubmit={handleSubmit}
        >Register</button>

        <p>{errorMessage}</p>







        </Rows>
        </form> 
        </Grid>
    </div>
  )
}
